import {createMuiTheme} from "@material-ui/core/styles";


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: [
            "Roboto, Arial",
            '"Bebas Neue"'
    ]
    },
    palette: {
        primary: {
            main: "#F5EB00",

        },
        secondary: {
            main: "#650CF5",
            dark: "#0000"
        },
        background:{
            default: "#ffff"
        },
        info: {
            main: "#F5EB00"
        }
    },
    shape: {
        borderRadius: 10
    },
    textPrimary: {
        main: "#0000"
    },
    textSecondary: {
        main: "#ffff"
    },
    
});

export default theme;
